import React from 'react';
import './App.css';

function App() {
  return <User>안녕하세요. 유저 휘인입니다.</User>
}

function User(props) {
  return <div>{props.children}</div>
}


function GrandFather() {
  const name = "이범규";
  return <Mother gfName={name} />;
}

function Mother(props) {
  return <Child gfName={props.gfName}/>
}

function Child({gfName}) {
  return <div>내 이름은 {gfName}입니다!</div>;
}


export default App;
